    name: 'üî®üë∑‚Äç‚ôÇÔ∏è **COB Break It Down!! June**',
    summary: '![Conquerors of Betterment Logo]',
    description:
      '## **The Situation**\n\nDoes this sound familiar? There\'s something you really, really want to accomplish, but every time you think about starting, you just get discouraged by the sheer enormity of it? Do you want to take a nap every time you even *think* about doing it? No worries! By breaking these big tasks and projects into smaller ones, we can get that feeling of accomplishment and over time, conquer our projects more easily.\n\n## **How Does This Challenge Work?**\n\nStart by identifying one daunting task (we\'ll call it your Focus Project). Next, spend a few minutes breaking that Focus Project down into smaller pieces; make these small enough that you can complete at least one each day! Then create a Hard To-Do representing the Focus Project, and easy To-Dos for each small task.\n\n## **Example:**\n\nIf you wanted to clean your house... you would probably divide it up into rooms and then in turn list the tasks for each room... eg. You might break it down into cleaning your desk, your laundry, your floor, and your furniture, and then further break those down into steps for each...\n\nüîπ Put away books (easy)\n\nüîπ Clear trash off of desk (easy)\n\nüîπ Put away things on desk (easy)\n\nüîπ Dust & wipe down desk (easy)\n\nüîπ Get all dirty clothes off the floor and into the wash basket (easy)\n\nüîπ Throw away all the rubbish (easy)\n\nüîπ Pick up all other items from floor (easy)\n\nüîπ Vacuum floor (easy)\n\nüîπ *Etc!*\n\n## **How Do I Win?**\n\nThis challenge ends at the end of each month and a new one will be put up for the following month! The winner will be randomly chosen from the people who have checked off "I completed my entire focus task!" and informed the COB Guild of their victory. üçÄ Good luck!\n\n### Join the ***Conquerors of Betterment*** Guild [Here!](https://habitica.com/groups/guild/51d6ffd2-7f44-4742-9626-07be10192134)',
